using Abot.Core;
using NUnit.Framework;

namespace Abot.Tests.Unit.Core
{

    [TestFixture]
    public class MemoryBloomUrlRepositoryTest : CrawledUrlRepositoryTest
    {
        public override ICrawledUrlRepository GetInstance()
        {
            return new MemoryBloomUrlRepository(.0001, 100000000);
        }

        [Test]
        public void AddIfNew_StringUri_AddingUniqueUri_ReturnsTrue()
        {
            MemoryBloomUrlRepository uut = this.GetInstance() as MemoryBloomUrlRepository;
            Assert.IsTrue(uut.AddIfNew(_uri1.AbsoluteUri));
        }

        [Test]
        public void AddIfNew_StringUri_AddingDuplicateUri_ReturnsFalse()
        {
            MemoryBloomUrlRepository uut = this.GetInstance() as MemoryBloomUrlRepository;
            uut.AddIfNew(_uri1);//Add first time

            bool result = uut.AddIfNew(_uri1.AbsoluteUri);

            Assert.IsFalse(result);
        }

        [Test]
        public void BloomState_ReturnsBase64String()
        {
            MemoryBloomUrlRepository uut = this.GetInstance() as MemoryBloomUrlRepository;
            uut.AddIfNew(_uri1);
            uut.AddIfNew(_uri2);

            string result = uut.BloomState;

            Assert.AreEqual("", result);
        }
    }
}
